import React, { useState, useEffect } from 'react';
import { Box, Typography, Button, Container, Card, CardContent, Grid, Accordion, AccordionSummary, AccordionDetails, Paper, CardMedia, CardActions } from '@mui/material';
import { styled } from '@mui/system';
import { motion, AnimatePresence } from "framer-motion";
import ImageGallery from 'react-image-gallery';
import { ParallaxProvider, Parallax as ParallaxScroll } from 'react-scroll-parallax';
import { Parallax as ParallaxReact } from 'react-parallax';
import ScrollProgressBar from 'react-scroll-progress-bar';
import ChevronRightIcon from '@mui/icons-material/ChevronRight';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import { green } from '@mui/material/colors';
import Typist from 'react-typist';
import CommentIcon from '@mui/icons-material/Comment';
import StarIcon from '@mui/icons-material/Star';
import HistoryIcon from '@mui/icons-material/History';
import NoMeetingRoomIcon from '@mui/icons-material/NoMeetingRoom';
import CleanHandsIcon from '@mui/icons-material/CleanHands';
import TimerIcon from '@mui/icons-material/Timer';
import AttachMoneyIcon from '@mui/icons-material/AttachMoney';
import CurrencyBitcoinIcon from '@mui/icons-material/CurrencyBitcoin';
import BusinessIcon from '@mui/icons-material/Business';
import VolumeOffIcon from '@mui/icons-material/VolumeOff';
import AiresBnBLogo from '../assets/Asset_5.png'; // Ensure this path is correct for your AiresBnB logo

const serviceList = [
    // Define AiresBnB services here
    // Example:
    {
        title: "Full Management",
        description: "Complete property management including booking, cleaning, and maintenance.",
        icon: <NoMeetingRoomIcon fontSize="large" sx={{ color: green[500] }} />,
    },
    // ... other services
];

const reviews = [
    // Define reviews here
    // Example:
    {
        text: "Excellent service, my property has never been in better hands.",
        author: "John Doe",
    },
    // ... other reviews
];

const images = [
    // Define images for the gallery
    // Example:
    {
        original: 'path/to/property/image1.jpg',
        thumbnail: 'path/to/property/thumbnail1.jpg',
    },
    // ... other images
];

const faqs = [
    // Define FAQs for AiresBnB
    // Example:
    {
        question: "How does the full management service work?",
        answer: "We handle everything from booking to maintenance, ensuring your property is well-cared for and profitable.",
    },
    // ... other FAQs
];

const Home = () => {
    const [visibleTagline, setVisibleTagline] = useState('');

    useEffect(() => {
        const tagline = "Discover Effortless Property Management";
        let index = 0;
        const interval = setInterval(() => {
            setVisibleTagline(tagline.substring(0, index));
            if (index < tagline.length) index++;
            else clearInterval(interval);
        }, 100);

        return () => clearInterval(interval);
    }, []);

    return (
        <div>
            <ScrollProgressBar height="5px" bgColor="#5cb85c" duration="1" />
            <StyledParallax
                blur={0}
                bgImage={AiresBnBLogo} // Update Hero Image URL
                strength={200}
            >
                <Background />
                <Banner>
                    <Container maxWidth="sm">
                        <Typography variant="h2" gutterBottom>
                            {visibleTagline}
                        </Typography>
                        <Typography variant="h5">
                            Maximizing your rental earnings with ease
                        </Typography>
                        <CustomButton>Learn More</CustomButton>
                    </Container>
                </Banner>
            </StyledParallax>

            {/* Service Offerings Section */}
            <Container maxWidth="md" sx={{ my: 5 }}>
                <Typography variant="h4" align="center" gutterBottom>
                    Our Services
                </Typography>
                <Grid container spacing={3}>
                    {serviceList.map((service, index) => (
                        <Grid item xs={12} sm={4} key={index}>
                            <Card>
                                <CardMedia
                                    component="img"
                                    height="140"
                                    image={service.icon} // Add service images
                                    alt={service.title}
                                />
                                <CardContent>
                                    <Typography gutterBottom variant="h5">
                                        {service.title}
                                    </Typography>
                                    <Typography variant="body2">
                                        {service.description}
                                    </Typography>
                                </CardContent>
                                <CardActions>
                                    <Button size="small">Learn More</Button>
                                </CardActions>
                            </Card>
                        </Grid>
                    ))}
                </Grid>
            </Container>

            {/* Property Gallery Section */}
            <Container maxWidth="md" sx={{ my: 5 }}>
                <Typography variant="h4" align="center" gutterBottom>
                    Property Gallery
                </Typography>
                <Grid container spacing={3}>
                    {/* Implement Property Gallery here */}
                </Grid>
            </Container>

            {/* FAQ Section */}
            <Container maxWidth="md" sx={{ my: 5 }}>
                <Typography variant="h4" align="center" gutterBottom>
                    Frequently Asked Questions
                </Typography>
                {faqs.map((faq, index) => (
                    <Accordion key={index}>
                        <AccordionSummary expandIcon={<ExpandMoreIcon />}>
                            <Typography>{faq.question}</Typography>
                        </AccordionSummary>
                        <AccordionDetails>
                            <Typography>
                                {faq.answer}
                            </Typography>
                        </AccordionDetails>
                    </Accordion>
                ))}
            </Container>
        </div>
    );
};

export default Home;
